🔞 В соцсетях публикуют фотографии из Донецка после обстрела ВСУ. 

Мэр города сообщил, что в районе Шахтерской погибли два человека. 

@ntvnews

«Украинская сторона не гнушается использовать мирных граждан в качестве живого щита. Реактивные системы залпового огня, орудия, крупнокалиберные минометы размещаются во дворах жилых домов, вблизи школ и детских садов». 

Заявление Шойгу. 

@ntvnews

Мюнхенский филармонический оркестр уволил дирижера Валерия Гергиева, сообщает DPA. 

Ранее его концерты отменили в Карнеги-холле и Парижской филармонии.

@ntvnews

«Каждый, кому стыдно быть русским, если уж невмоготу, может найти для себя другую страну». 

Говорим о тех, кому сейчас «стыдно за Россию». 

@ntvnews

Одной рукой высылая российских представителей, другой США подают знаки о возможности смягчения санкций, но c оговоркой, что это произойдет только в том случае, если Россия начнет деэскалацию на Украине.

«Эти экономические меры призваны оказать давление на Российскую Федерацию, чтобы она поступила правильно — завершила этот конфликт. Если это произойдет, меры будут соответствующим образом откалиброваны. Если это не произойдет, если Россия продолжит эскалацию, эти меры будут тоже соответствующим образом откалиброваны», — заявил официальный представитель Госдепартамента США Нед Прайс ⁠https://www.ntv.ru/novosti/2687083/

@ntvnews

Бывший советника главы ДНР, у которого большой опыт жизни в Донецке, рассказывает, как мирным жителям себя обезопасить: 

▪️желательно из дома не выходить и ни в коем случае не выпускать детей;
▪️отбирать у подростков телефоны, чтобы они не полезли что-нибудь снимать;
▪️не снимать из окон — если ваш телефон бликанет, дом могут обстрелять;
▪️прятаться лучше в ванну, но в самой ванной комнате нужно обязательно убрать зеркала и любые стеклянные предметы;
▪️забудьте о появлении из подъезда в комендантский час.

@ntvnews

Полезные советы киевлянам от бывшего советника главы ДНР — как обезопасить себя во время эвакуации:

▪️не выезжать на одной машине, передвигаться только в составе автоколонны;
▪️на окна машин клеить знаки «дети»;
▪️подготовить документы;
▪️не выключать телефон;
▪️ехать строго по гумкоридору; 
▪️спрашивать у российских солдат о дальнейшей обстановке на дороге. 

@ntvnews

Россия и Украина обсудили возможность проведения второго раунда переговоров в ближайшее время, сообщил советник главы офиса Зеленского Подоляк.

«Стороны определили ряд приоритетных тем, по которым наметились определенные решения. Ради того, чтобы эти решения получили какие-то возможности имплементации в логистические решения, стороны уезжают для консультаций».

@ntvnews

«Если нужна какая-то наличка, идите на всякий случай — снимите, но не надо всё бежать (снимать — ред.)!»

Эксперты объяснили, почему не нужно снимать все рубли с банковских счетов.

@ntvnews

«Тем, кто живет от зарплаты до зарплаты, эти санкции абсолютно неинтересны, они их не коснутся». 

Эксперты о том, как на рядовом россиянине отразятся западные санкции. 

@ntvnews

«Военные действия со стороны режима в Киеве и планомерное уничтожение жителей Донбасса шли 8 лет. В ходе этой войны, погибло более 14 тысяч человек, сотни детей. Этому было необходимо положить конец. Надо было положить конец бесконечным угрозам со стороны киевского режима в адрес России. И Россия это сделает».

Заявление Минобороны РФ. 

@ntvnews

Крым на прошлой неделе принял первых беженцев. Из 500 человек в пункте временного размещения по другую сторону Азова половина — дети, вторая — женщины. После суматохи первых дней эвакуации люди начинают обживаться на новых местах.

Рассказываем, как живут вынужденные переселенцы из Донбасса. 

@ntvnews

В Харькове украинские националисты готовят к пуску системы залпового огня в спальных районах рядом с домами, в Мариуполе техника появилась во дворе одной из школ. У некоторых жителей Киева бронетехника стоит прямо под окнами квартир.

Так «доблестная армия Украины» пытается использовать простых людей как живой щит.

@ntvnews

Все больше солдат ВСУ сдают оружие. Они говорят, что воевать им нечем, они разочарованы и им всё надоело.  

Рассказываем об украинских пленных.

@ntvnews

В сторону Донбасса продолжает лететь почти всё, что есть на вооружении у ВСУ. Днем и ночью — по прифронтовым поселкам или глубоко в тылу. 

Рассказываем об остановке в республиках. 

@ntvnews

Российский боксер Александр Поветкин:

«Сила в правде. Эта известная фраза, которую произнес Сергей Бодров, сегодня отражает суть происходящего на Украине. Мы бились за правду все эти годы, пока на Донбассе истребляли славян. Поэтому я за президента и его решение — встать на защиту простых людей». 

@ntvnews

Кадыров показал новое видео с чеченскими силовиками. 

«Бескомпромиссные и универсальные бойцы из Чеченской Республики, которые стремительной лавиной накрывают любые препятствия на своём пути!», — написал он в телеграме. 

@ntvnews

Telegram не будет ограничивать каналы в России и на Украине. Дуров объяснил, что многие пользователи обратились с просьбой не рассматривать отключение Telegram-каналов на период конфликта, так как мессенджер для них — единственный источник информации:

«В связи с этими обращениями мы приняли решение не рассматривать подобные меры. Однако еще раз прошу перепроверять и не принимать на веру данные, которые публикуются в Telegram-каналах в этот непростой период».

@ntvnews

Мединский о переговорах с Украиной: «Мы уже собирались уезжать, но буквально около трех часов поступила информация с украинской стороны о заинтересованности».

Он добавил, что каждый час — это спасенные жизни украинских граждан и тех украинских солдат, которые находятся на линии противостояния.

@ntvnews

В соцсетях появилось видео, на котором люди с оружием стреляют в человека на улице. Утверждается, что оно снято в Киеве и пострадавший — нарушитель комендантского часа. Так ли это, неизвестно. 

Накануне мэр Киева Виталий Кличко заявил, что все нарушители комендантского часа будут по умолчанию считаться вражескими диверсантами.

@ntvnews

Франция вслед за Нидерландами и Италией закрывает небо для российских авиакомпаний. Ранее такое же решение приняли Исландия, Ирландия, Австрия и Дания.

В Минтрансе сообщили, что авиационные власти России будут действовать зеркально в адрес стран, которые закрыли свое небо для наших самолетов. На сегодняшний день наше воздушное пространство закрыто для авиалайнеров, принадлежащих Болгарии, Чехии, Польше, Румынии, Словении, Латвии, Литве, Эстонии и Великобритании.

@ntvnews

«У кого есть желание — быстро приезжайте и берите». 

Еще видео из Запорожья, где жителям раздают оружие. 

@ntvnews

Еще 30 военнослужащих ВСУ, сотрудников пограничной и таможенной службы добровольно сложили оружие и обратились за помощью к ВС РФ.

После письменного отказа от участия в боевых действиях они смогут вернуться домой.

@ntvnews

«Все сидят в Гомеле и ждут. Приедут — будут переговоры. Не приедут, как президент России вчера мне сказал, ну что делать, значит это их выбор».

Лукашенко о переговорах в Гомеле. 

@ntvnews

«Сколько крови пролито, сколько наших ребят погибло… Конечно, мы благодарны России за то, что она нас не покинула». 

Жители Донецкой области благодарят освободителей. 

@ntvnews

Станицу Луганская вчера освободили без единого выстрела. 

Видео о том, как встречали армию ЛНР в освобожденной станице. 

@ntvnews

«Спасибо нашей „доблестной украинской армии“. Чтоб вы так жили, как мы живем». 

Рассказываем, как ВСУ продолжают разносить ракетами жилые дома Донбасса. 

@ntvnews

В городе Ровеньки после ракетного удара загорелась нефтебаза. Горит, по данным местных властей, 200 тонн дизельного топлива.

По предварительной информации, есть пострадавшие. 

@ntvnews

Раздача оружия на Украине, судя по всему, идет полным ходом. 

Говорят, этого Рэмбо сфотографировали в городе Сумы. 

@ntvnews

Кадыров опубликовал видео с трофеями. 

«Вот еще трофейное оружие, захваченное нашими бойцами! Не знаем чье производство. Может вы в курсе?», — подписал глава Чечни. 

@ntvnews

Порошенко снова вещает в эфире CNN. На этот раз без автомата. 

Зато рассказывает, как якобы остановил Россию в 2014-м и пытается остановить сейчас. 

@ntvnews

«Они ненавидели их и ненавидят. Всех, кто там живет».

Маргарита Симоньян @margaritasimonyan рассказала, как Украина в 2014-м бомбила кассетными бомбами детский пляж.

@ntvnews

Американского эксперта спросили: «Ты же знаешь, что на протяжении 8 лет они обстреливали мирных людей, убивали мирных людей?» 

Его ответ — демонстрация отношения коллективного Запада.

@ntvnews

❌ Сборная Швеции по футболу отказалась играть с Россией возможный стыковой матч за право выхода на чемпионат мира в Катаре.

Эта встреча могла бы состояться в случае победы нашей сборной в полуфинале стыков над поляками 24 марта, но те тоже отказались выходить на поле.

@ntvnews

Жириновского подключили к ИВЛ и ввели в медикаментозный сон из-за ухудшения состояния, сообщают СМИ.

UPD: Пресс-служба ЛДПР опровергла эту информацию.

@ntvnews

«Ты не хотел нейтральный статус Украины — теперь у тебя не будет Украины».

Маргарита Симоньян @margaritasimonyan обратилась к Зеленскому.

@ntvnews

Жилой дом в Киеве был поражен ракетой комплекса Бук-М1 вооруженных сил Украины, сообщил источник в Минобороны РФ. 

«В ходе отражения ночного ракетного обстрела объектов военной инфраструктуры ВСУ Украины произошел отказ в системе наведения ракеты украинского ЗРК средней дальности „Бук-М1“ и ракета задела угол жилого дома».

@ntvnews

Российский флаг в Мелитополе.

Сегодня в Минобороны РФ сообщили, что город перешел под контроль ВС РФ. 

@ntvnews

«Семён Слепаков написал, что, вот бы был жив Жванецкий, который из Одессы, и как бы он на это посмотрел. Но ему даже в голову не приходит, что Одессу освобождают от тех, кто ее сжег. Кто безнаказанно спалил людей в Доме профсоюзов». 

Маргарита Симоньян @margaritasimonyan в эфире НТВ. 

@ntvnews

«Защитники грёбаные, тикают ****. Вот так доблестная армия Украины прячется среди школ». 

Техника ВСУ стоит в жилых кварталах.

@ntvnews

«Поселок взят без единого выстрела, украинские войска из него ушли». 

ЛНР показывает первые кадры из освобожденной станицы Луганской.

@ntvnews

Маргарита Симоньян @margaritasimonyan о том, что ВСУ поступают, как террористы, размещая «Грады» в жилых районах:

«Они просят Путина: разбомби наш народ». 

@ntvnews

Фейк от Минобороны Украины. В своих официальных аккаунтах оно показало видео, на котором якобы их истребитель сбивает российский. 

Но это кадры из компьютерного симулятора Digital Combat Simulator. Разработчик игры уже подтвердил, что это эпизод из DCS. 

@ntvnews

Пушилин о пленных украинцах:

«Задача — чтобы как можно больше солдат ВСУ сложили оружие. Сохранить как можно больше жизней, даже нашего противника». 

@ntvnews

«Есть определенная часть людей, которая причисляет самих себя к интеллигенции, которая, не понимая, что происходит, очень громко говорят „нет войне“. И главное — говорят, что им стыдно, что они русские. Мне, например, стыдно, что они мои сограждане».

Маргарита Симоньян @margaritasimonyan в эфире НТВ. 

@ntvnews

«Горит все».

Еще одно видео из ночного Киева.

@ntvnews

Зеленский выступил с очередным обращением к жителям Украины, в котором рассказал, что договорился с мировыми лидерами о новой значительной помощи стране. 

Также украинский президент заявил, что российские войска собираются ночью штурмовать Киев: «Эту ночь мы должны выстоять, судьба Украины решается прямо сейчас. Ночь будет тяжелой. Очень тяжелой».

@ntvnews

Захарова: «Ни у Путина, ни у Лаврова нет счетов ни в Британии, ни где-либо за рубежом. Может, правительство Королевства не заморозило, а отморозило что-то?».

Ранее правительство Великобритании сообщило, что ввело санкции против Путина и Лаврова и заморозило их счета. 

@ntvnews

«Уже сотни бойцов ВСУ приняли единственное правильное решение — сложили оружие и перестали выполнять преступные приказы киевского режима… Их отпустят домой, они вернутся к своим родным и близким». 

Заявление главы ЛНР Пасечника. 

@ntvnews

«Они заявляли, что будут бить по верхушке страны и так далее, Байден говорит, что русский народ мне близок, я за него переживаю, как же вы там, бедные, держитесь. Но они пытаются бить по простым российским людям».

Разбираемся, так ли страшны нам эти санкции, как их малюют.

@ntvnews

«Многие сейчас говорят „стыдно быть русским“ и „нет войне“. Друзья, война — это ужасно, любую войну нужно не начинать, а прекращать, но где вы были последние 8 лет? Куда вы смотрели? У вас не было глаз? У вас не было ушей? У вас что-то с мозгами было не в порядке? 

Украина последние сутки живет примерно так, как Донецк и Луганск последние 8 лет». 

@ntvnews

Путин на заседании Совбеза призвал украинских силовиков отречься от «шайки наркоманов и неонацистов». 

Полная версия заявления. 

@ntvnews

Грузия не собирается участвовать в санкциях, введенных против России, заявил премьер-министр страны Гарибашвили.

«Мы ознакомились с действиями наших международных партнеров, которые последовали после начала военных действий на Украине. Я хочу четко и однозначно заявить, что Грузия с учетом наших национальных интересов не собирается участвовать в финансовых и экономических санкциях». 

@ntvnews

Жительница Донецка:

«Украина очень больна. Это сейчас не война, это — отобрать у обезьяны гранату. Я за мир между братскими народами, но мы здесь жили 8 лет под обстрелами. Я желаю Украине выздоровления». 

@ntvnews

❗️ Обращение к гражданам Украины от Минобороны России:

«Ваше националистическое руководство применяет те же методы, как и террористы. Вас хотят использовать как живой щит. Российские вооруженные силы никаких ударов по жилым кварталам украинской столицы наносить не будут».

@ntvnews

Минобороны заявило, что вчера была проведена успешная высадка десанта в районе аэродрома Гостомель в пригороде Киева.

При захвате были уничтожены более 200 националистов из состава специальных подразделений Украины. Потерь в российских вооруженных силах нет.

@ntvnews

«Смотрите, что происходит на Оболони. Даже без документов раздают оружие». 

В сетях появилось видео, на котором, предположительно, ВСУ раздают оружие всем желающим прямо из грузовиков.

@ntvnews

Вчера в соцсетях разлетелась эта запись «боевых действий на Украине», которая на деле оказалось геймплеем видеоигры Arma 3.

Будьте внимательны и всегда перепроверяйте информацию.

@ntvnews

«Не „мама“ и „папа“, а „бах“ и „танк“. А потом уже был „папа“». 

Виктория, которая живет вместе с маленьким ребенком недалеко от донецкого аэропорта, рассказывает, какими были первые слова ее сына. 

@ntvnews

Видео о том, что за последние годы пришлось пережить жителям Донбасса. Как им устраивали блокаду — оставляли без света, воды, еды и связи. 

Хуже всем пришлось тем, кто жил в «серой зоне» — их фактически использовали как живой щит. 

@ntvnews

Наш корреспондент показывает один из первых захваченных у ВСУ противотанковых комплексов, которые Украине поставляла Британия. 

Украинские военные побросали комплексы при отступлении из Лопаскино. 

@ntvnews

«Мой прадед боролся с фашизмом, а сейчас этот фашизм на Украине. Я это неприемлю».

Минобороны опубликовало кадры, как украинские военные добровольно складывают оружие, после чего их отпускают домой.

@ntvnews

«Когда я поняла, что его рядом нет, я начала плакать. Что будет дальше? Будущее для нас неизвестно». 

